import React from 'react';
import GoogleMapReact from 'google-map-react';

const AnyReactComponent = ({ text }) => <div>{text}</div>;

const GoogleMap = () => {
  const defaultProps = {
    center: {
      lat: 4.6952, // Initial latitude
      lng: -74.0309, // Initial longitude
    },
    zoom: 14, // Initial zoom level
  };

  const markers = [
    {
      id: 1,
      lat: 4.739583547087595, // Marker 1 latitude
      lng: -74.02855219668066, // Marker 1 longitude
    },
    // Add more markers as needed
  ];

  return (
    <div style={{ height: '1150px', width: '100%' }}>
      <GoogleMapReact
        bootstrapURLKeys={{
          key: 'AIzaSyBoEQde7SsgSK7o3C89akbT1Z6dDl2T6nA', // Replace with your Google Maps API key
        }}
        defaultCenter={defaultProps.center}
        defaultZoom={defaultProps.zoom}
      >
        {markers.map((marker) => (
          <AnyReactComponent
            key={marker.id}
            lat={marker.lat}
            lng={marker.lng}
            text="Marker"
          />
        ))}
      </GoogleMapReact>
    </div>
  );
};

export default GoogleMap;
